window.bookSummaryJSON = "<p><i>Edward Wright is the Dungeon Lord, a Dark champion chosen by the Dark god, Murmur, to lead armies of minions against the forces of the Light in the eternal battle for the soul of the world of Ivalis.</i></p> <p>After barely surviving the Endeavor of the Factory of Nightmares, Dungeon Lord Edward Wright was banished back to Earth.</p> <p>Stranded in a world without magic, the Dungeon Lord must now find a way to return to the magical realm of Ivalis. If his enemies realize he’s disappeared, they’ll undoubtedly fall upon his dungeon like vultures.</p> <p>Worse yet, he’s not alone on Earth. The Silver Knights, the order of the ancient warriors that defeated Lord Sephar long ago, are back and ready to vanquish another Dungeon Lord. Behind them hides an individual who may connect Ed to the mighty Heroes, the unbeatable machines of the Light.</p> <p>Meanwhile, Ed’s friends and allies face the wrath of the Inquisition, as well as the raids of evil Dungeon Lords looking to claim Lord Wraith’s secrets for themselves. It is only a matter of time before one of their foes to get lucky and draw blood.</p> <p>War brews in the horizon of Starevos, and the threat of the reborn Lord Sephar lurks in the shadows. Only Ed stands in the middle of the terrible clash of the Dark and the Light.</p> <p>This time, if Ed wants to protect those dear to him, he’ll have to unleash war and take a crown for himself.</p> <p>If he dares to pay the price.</p>"; 
